import React from "react";
import ReactDOM from "react-dom/client";

function App() {
  return <div className="card">A</div>;
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
